import { createContext } from "react";
import context from "react-bootstrap/esm/AccordionContext";

export const Context = createContext({});

export const AppContext = ({children}) => {
    return (
        <Context.Provider value={{ name: 'Maytê' }}>
            {children}
        </Context.Provider>
    )
}
